import React from "react";
import Style from '../styles/NavBar.module.css'

export default function NavBar() {
    return (
        <div className={Style.navbar}>
            <ul className={Style.ul}>
                <li className={Style.li}><a href="">Inicio</a></li>
                <li className={Style.li}><a href="">Quien soy</a></li>
                <li className={Style.li}><a href="">proyectos</a></li>
                <li className={Style.li}><a href="">Teconologias</a></li>
                <li className={Style.li}><a href="">Contacto</a></li>
            </ul>
            <button><FontAwesomeIcon icon={faHome}/></button>
        </div>
    )
}
